import React, { useState } from "react";
import { Box, Radio, RadioGroup, Stack, Text, Input } from "@chakra-ui/react";
import * as C from "./styled";

const FormularioTabela = () => {
  const [novaInstalacao, setNovaInstalacao] = useState("");
  const [consumoMedio, setConsumoMedio] = useState("");

  const handleChangeNovaInstalacao = (event) => {
    setNovaInstalacao(event.target.value);
  };

  const handleChangeConsumoMedio = (event) => {
    setConsumoMedio(event.target.value);
  };

  return (
    <C.FullContainer>
      {/* Formulário */}
      <C.Container>
        <Stack spacing={4}> {/* Utilize o componente Stack */}
          <Text fontSize="xl" fontWeight="bold">
            Calculadora de exemplo
          </Text>
          <Box>
            <Text>Instalação nova: </Text>
            <RadioGroup value={novaInstalacao} onChange={handleChangeNovaInstalacao}>
              <Stack direction="row">
                <Radio value="sim">Sim</Radio>
                <Radio value="nao">Não</Radio>
              </Stack>
            </RadioGroup>
          </Box>

          <Box>
            <Text>Consumo médio nos últimos 12 meses:</Text>
            <Input
              type="text"
              value={consumoMedio}
              onChange={handleChangeConsumoMedio}
              placeholder="Digite o consumo médio"
            />
          </Box>
        </Stack>
      </C.Container>

      {/* Espaço */}
      <C.Espaco />

      {/* Tabela */}
      <C.Container>
        <Text fontSize="xl" fontWeight="bold">
          Tabela de 3 colunas e 3 linhas:
        </Text>
        <C.Tabela>
          <thead>
            <C.TabelaLinha>
              <C.TabelaCabecalho>Coluna 1</C.TabelaCabecalho>
              <C.TabelaCabecalho>Coluna 2</C.TabelaCabecalho>
              <C.TabelaCabecalho>Coluna 3</C.TabelaCabecalho>
            </C.TabelaLinha>
          </thead>
          <tbody>
            <C.TabelaLinha>
              <C.TabelaCelula>Linha 1, Coluna 1</C.TabelaCelula>
              <C.TabelaCelula>Linha 1, Coluna 2</C.TabelaCelula>
              <C.TabelaCelula>Linha 1, Coluna 3</C.TabelaCelula>
            </C.TabelaLinha>
            <C.TabelaLinha>
              <C.TabelaCelula>Linha 2, Coluna 1</C.TabelaCelula>
              <C.TabelaCelula>Linha 2, Coluna 2</C.TabelaCelula>
              <C.TabelaCelula>Linha 2, Coluna 3</C.TabelaCelula>
            </C.TabelaLinha>
            <C.TabelaLinha>
              <C.TabelaCelula>Linha 3, Coluna 1</C.TabelaCelula>
              <C.TabelaCelula>Linha 3, Coluna 2</C.TabelaCelula>
              <C.TabelaCelula>Linha 3, Coluna 3</C.TabelaCelula>
            </C.TabelaLinha>
          </tbody>
        </C.Tabela>
      </C.Container>
    </C.FullContainer>
  );
};

export default FormularioTabela;
